import React from 'react';
import { Stack,Grid,Typography,Button } from '@mui/material';

export default function Home() {
  return (
    <Grid container justifyContent="center" sx={{ bgcolor: '#cfe8fc', height: '30rem', width:'100%'}}>
      <Grid>
        <Typography variant="h2" component="div" columns={1} gutterBottom>
          Eden's Garden
        </Typography>
        <Button variant="contained">Get Started</Button>
      </Grid>
    </Grid>
  );
}
